Sets the state of the book, including how open/closed it is and how far the left and right pages are flipped.

@param rightPageFlipAmount How far over the right page is flipped.
@param leftPageFlipAmount How far over the left page is flipped.

Writes this entity to NBT, unless it has been removed or it is a passenger. Also writes this entity's passengers, and the entity type ID (so the produced NBT is sufficient to recreate the entity).
To always write the entity, use {@link #writeWithoutTypeId}.

@return True if the entity was written (and the passed compound should be saved); false if the entity was not written.

Filter a string, keeping only characters for which {@link #isAllowedCharacter(char)} returns true.

Note that this method strips line breaks, as {@link #isAllowedCharacter(char)} returns false for those.
@return A filtered version of the input string
